import { ContractAbi } from 'web3x/contract'
export default new ContractAbi([
  {
    inputs: [
      {
        internalType: 'contract IENSRegistry',
        name: '_registry',
        type: 'address'
      },
      {
        internalType: 'contract IBaseRegistrar',
        name: '_base',
        type: 'address'
      },
      {
        internalType: 'string',
        name: '_topdomain',
        type: 'string'
      },
      {
        internalType: 'string',
        name: '_domain',
        type: 'string'
      },
      {
        internalType: 'string',
        name: '_baseURI',
        type: 'string'
      }
    ],
    payable: false,
    stateMutability: 'nonpayable',
    type: 'constructor'
  },
  {
    anonymous: false,
    inputs: [
      {
        indexed: true,
        internalType: 'address',
        name: 'owner',
        type: 'address'
      },
      {
        indexed: true,
        internalType: 'address',
        name: 'approved',
        type: 'address'
      },
      {
        indexed: true,
        internalType: 'uint256',
        name: 'tokenId',
        type: 'uint256'
      }
    ],
    name: 'Approval',
    type: 'event'
  },
  {
    anonymous: false,
    inputs: [
      {
        indexed: true,
        internalType: 'address',
        name: 'owner',
        type: 'address'
      },
      {
        indexed: true,
        internalType: 'address',
        name: 'operator',
        type: 'address'
      },
      {
        indexed: false,
        internalType: 'bool',
        name: 'approved',
        type: 'bool'
      }
    ],
    name: 'ApprovalForAll',
    type: 'event'
  },
  {
    anonymous: false,
    inputs: [
      {
        indexed: false,
        internalType: 'string',
        name: '_oldBaseURI',
        type: 'string'
      },
      {
        indexed: false,
        internalType: 'string',
        name: '_newBaseURI',
        type: 'string'
      }
    ],
    name: 'BaseURI',
    type: 'event'
  },
  {
    anonymous: false,
    inputs: [
      {
        indexed: true,
        internalType: 'contract IBaseRegistrar',
        name: '_previousBase',
        type: 'address'
      },
      {
        indexed: true,
        internalType: 'contract IBaseRegistrar',
        name: '_newBase',
        type: 'address'
      }
    ],
    name: 'BaseUpdated',
    type: 'event'
  },
  {
    anonymous: false,
    inputs: [
      {
        indexed: true,
        internalType: 'address',
        name: '_controller',
        type: 'address'
      }
    ],
    name: 'ControllerAdded',
    type: 'event'
  },
  {
    anonymous: false,
    inputs: [
      {
        indexed: true,
        internalType: 'address',
        name: '_controller',
        type: 'address'
      }
    ],
    name: 'ControllerRemoved',
    type: 'event'
  },
  {
    anonymous: false,
    inputs: [
      {
        indexed: true,
        internalType: 'uint256',
        name: '_tokenId',
        type: 'uint256'
      }
    ],
    name: 'DomainReclaimed',
    type: 'event'
  },
  {
    anonymous: false,
    inputs: [
      {
        indexed: true,
        internalType: 'address',
        name: '_newOwner',
        type: 'address'
      },
